// lscht Anhnge
// erwartet den Datensatz als Objekt und das Objekt, dass geklickt wurde
window.em.lscheAnhang = function(that, Objekt, id) {
	'use strict';
	if (Objekt) {
		// Es wurde ein Objekt bergeben, keine DB-Abfrage ntig
		window.em.lscheAnhang_2(that, Objekt);
	} else {
		// Objekt aus der DB holen
		var $db = $.couch.db("evab");
		$db.openDoc(id, {
			success: function(data) {
				window.em[Objekt.Typ] = data;
				window.em.lscheAnhang_2(that, window.em[Objekt.Typ]);
			},
			error: function() {
				window.em.melde("Fehler: Anhang wurde nicht entfernt");
			}
		});
	}
};

window.em.lscheAnhang_2 = function(that, Objekt) {
	'use strict';
	var Dateiname = that.id;
	// Anhang aus Objekt entfernen
	delete window.em[Objekt.Typ]._attachments[Dateiname];
	// Objekt in DB speichern
	$db.saveDoc(window.em[Objekt.Typ], {
		success: function(data) {
			// rev im Objekt ergnzen
			// die globale Variable heisst gleich, wie der Typ im Objekt
			window.em[Objekt.Typ]._rev = data.rev;
			// im Formular den Anhang und die Lsch-Schaltflche entfernen
			$(that).parent().parent().remove();
		},
		error: function() {
			window.em.melde("Fehler: Anhnge werden nicht richtig angezeigt");
		}
	});
};

