window.em.handleFeldEditMeineEinstellungenChange = function() {
	'use strict';
	var feldname = this.name,
		feldwert = this.value;
	// prfen, ob das Feld als Objekt vorliegt
	if (window.em.Feld) {
		// bestehendes Objekt verwenden
		window.em.handleFeldEditMeineEinstellungenChange_2(feldname, feldwert);
	} else {
		// Objekt aus der DB holen
		var $db = $.couch.db("evab");
		$db.openDoc(localStorage.FeldId, {
			success: function(data) {
				window.em.Feld = data;
				window.em.handleFeldEditMeineEinstellungenChange_2(feldname, feldwert);
			},
			error: function() {
				window.em.melde("Fehler: Die letzte nderung wurde nicht gespeichert");
			}
		});
	}
};

window.em.handleFeldEditMeineEinstellungenChange_2 = function(feldname, feldwert) {
	'use strict';
	// Sichtbarkeitseinstellungen: In einem Array werden die User aufgelistet, welche das Feld sehen
	// Es muss geprft werden, ob der aktuelle User in diesem Array enthalten ist
	if (feldwert === "ja") {
		// User ergnzen, wenn noch nicht enthalten
		window.em.Feld[feldname] = _.union(window.em.Feld[feldname], localStorage.Email);
	} else if (feldwert === "nein") {
		// User entfernen, wenn enthalten
		window.em.Feld[feldname] = _.without(window.em.Feld[feldname], localStorage.Email);
	}
	var $db = $.couch.db("evab");
	$db.saveDoc(window.em.Feld, {
		success: function(data) {
			window.em.Feld._rev = data.rev;
		},
		error: function() {
			window.em.melde("Fehler: Die letzte nderung wurde nicht gespeichert");
		}
	});
};

// wenn in FeldEdit.htm .Feldeigenschaften gendert wird
// jedes Feld aus Feldeigenschaften bei nderung speichern
window.em.handleFeldEditFeldeigenschaftenChange = function() {
	'use strict';
	localStorage.FeldWert = this.value;
	if (this.name) {
		localStorage.FeldName = this.name;
		localStorage.AlterFeldWert = window.em.Feld[this.name];
	} else {
		localStorage.FeldName = this.id;
		localStorage.AlterFeldWert = window.em.Feld[this.id];
	}
	// Felder der Datenzentren drfen nicht verndert werden
	// ausser Standardwert, dessen nderung wird aber in einer anderen Funktion verarbeitet
	// aber: Der Benutzer soll whlen knnen, in welchen Artgruppen er ein solches Feld anzeigt
	if (window.em.Feld.User === "ZentrenBdKt" && localStorage.FeldName !== "ArtGruppe") {
		// feldwert zurcksetzen
		if (localStorage.AlterFeldWert) {
			$("#" + localStorage.FeldName).val(localStorage.AlterFeldWert);
		} else {
			$("#" + localStorage.FeldName).val("");
		}
		delete localStorage.FeldName;
		delete localStorage.FeldWert;
		delete localStorage.AlterFeldWert;
		window.em.melde("Dies ist ein geschtztes Feld eines ffentlichen Datenzentrums<br><br>Statt dieses zu ndern knnen Sie ein eigenes Feld erstellen");
	} else if (localStorage.FeldName === "FeldName") {
		// Wenn eigener Feldname verndert wird, kontrollieren, dass er nicht schon verwendet wurde
		// ohne explizit auf undefined zu prfen, akzeptierte die Bedingung einen alten feldwert von
		// undefined als o.k.!!!!
		if (localStorage.AlterFeldWert !== "undefined" && localStorage.AlterFeldWert) {
			// wenn ein alter Feldname existiert,
			// zhlen, in wievielen Datenstzen das Feld verwendet wird
			var $db = $.couch.db("evab");
			$db.view('evab/FeldSuche?key="' + localStorage.Email + '"&include_docs=true', {
				success: function(data) {
					var anzVorkommen = 0,
						Datensatz,
						feldname,
						ds;
					// zhlen, in wievielen Datenstzen das bisherige Feld verwendet wird
					_.each(data.rows, function(row) {
						Datensatz = row.doc;
						feldname = Datensatz[localStorage.AlterFeldWert];
						if (feldname) {
							anzVorkommen ++;
						}
					});
					if (anzVorkommen === 0) {
						// alter Feldname wurde noch in keinem Datensatz verwendet
						// prfen, ob der neue Feldname schon existiert
						// wenn ja: melden, zurckstellen
						// wenn nein: speichern
						window.em.prfeFeldNamen();
					} else {
						// Feldname wird schon verwendet > melden, zurckstellen
						ds = "Datenstzen";
						if (anzVorkommen === 1) {
							ds = "Datensatz";
						}
						$("#FeldName").val(localStorage.AlterFeldWert);
						delete localStorage.FeldName;
						delete localStorage.FeldWert;
						delete localStorage.AlterFeldWert;
						window.em.melde("Dieses Feld wird in " + anzVorkommen + " " + ds + " verwendet.<br>Es kann deshalb nicht verndert werden.<br>Bereinigen Sie zuerst die Daten.");
					}
				}
			});
		} else {
			// Vorher gab es keinen Feldnamen
			// prfen, ob der neue Feldname schon existiert
			// wenn ja: melden, zurckstellen
			// wenn nein: speichern
			window.em.prfeFeldNamen();
		}
	} else if (localStorage.FeldName === "Hierarchiestufe" && localStorage.FeldWert === "Art") {
		$(".FeldEditHeaderTitel").text(localStorage.FeldWert + ": " + window.em.Feld.FeldBeschriftung);
		window.em.leereStorageFeldListe();
		window.em.speichereFeldeigenschaften();
		// Wenn die Hierarchiestufe zu Art gendert wird, muss das Feld fr die Artgruppe aufgebaut werden
		window.em.ArtGruppeAufbauenFeldEdit();
		window.em.melde("Jetzt mssen Sie whlen, in welchen Artgruppen dieses Feld angezeigt werden kann");
	} else if (localStorage.FeldName === "Hierarchiestufe" && localStorage.FeldWert !== "Art") {
		$(".FeldEditHeaderTitel").text(localStorage.FeldWert + ": " + window.em.Feld.FeldBeschriftung);
		if (window.em.Feld.Hierarchiestufe === "Art") {
			// Wenn die Hierarchiestufe Art war und gendert wird, muss das Feld fr die Artgruppe entfernt werden
			$("#Artgruppenliste_FeldEdit").empty();
            $("#SichtbarInHArtEditListeFieldContain").hide();
		}
		window.em.leereStorageFeldListe();
		window.em.speichereFeldeigenschaften();
	} else {
		if (localStorage.FeldName === "FeldBeschriftung") {
			$(".FeldEditHeaderTitel").text(window.em.Feld.Hierarchiestufe + ": " + localStorage.FeldWert);
		}
		window.em.speichereFeldeigenschaften();
	}
	window.em.blendeDatentypabhngigeFelder();
};

window.em.blendeDatentypabhngigeFelder = function() {
	'use strict';
    var $feldedit_inputtyp = $("#feldedit_inputtyp"),
        $feldedit_optionen = $("#feldedit_optionen"),
        $feldedit_slider = $(".feldedit_slider");
	switch (window.em.Feld.Formularelement) {
		case "textinput":
			$feldedit_inputtyp.show();
			$feldedit_optionen.hide();
			$feldedit_slider.hide();
			break;
		case "selectmenu":
		case "multipleselect":
		case "radio":
		case "checkbox":
			$feldedit_optionen.show();
			$feldedit_inputtyp.hide();
			$feldedit_slider.hide();
			break;
		case "slider":
			$feldedit_slider.show();
			$feldedit_inputtyp.hide();
			$feldedit_optionen.hide();
			break;
		default:
			$feldedit_slider.hide();
			$feldedit_inputtyp.hide();
			$feldedit_optionen.hide();
			break;
	}
};

