// wenn in hProjektEdit.html #LscheProjektProjektEdit geklickt wird
window.em.handleHProjektEditLscheProjektClick = function() {
	'use strict';
	// Anzahl Rume des Projekts zhlen
	// die Abfrage verwenden, um die Datenstze spter direkt zu lschen, ohne weitere DB-Abfrage
	var $db = $.couch.db("evab");
	$db.view('evab/hRaumIdVonProjekt?startkey=["' + localStorage.ProjektId + '"]&endkey=["' + localStorage.ProjektId + '",{},{}]', {
		success: function(Raeume) {
			var anzRaeume = Raeume.rows.length;
			// Anzahl Orte des Projekts zhlen
			$db.view('evab/hOrtIdVonProjekt?startkey=["' + localStorage.ProjektId + '"]&endkey=["' + localStorage.ProjektId + '",{},{}]', {
				success: function(Orte) {
					var anzOrte = Orte.rows.length;
					// Anzahl Zeiten des Projekts zhlen
					$db.view('evab/hZeitIdVonProjekt?startkey=["' + localStorage.ProjektId + '"]&endkey=["' + localStorage.ProjektId + '",{},{}]', {
						success: function(Zeiten) {
							var anzZeiten = Zeiten.rows.length;
							// Anzahl Arten des Projekts zhlen
							$db.view('evab/hArtIdVonProjekt?startkey=["' + localStorage.ProjektId + '"]&endkey=["' + localStorage.ProjektId + '",{},{}]', {
								success: function(Arten) {
									var anzArten = Arten.rows.length, 
										$hoe_lschen_meldung = $("#hoe_lschen_meldung"),
										rume_text = (anzRaeume === 1 ? ' Raum, ' : ' Rume, '),
										orte_text = (anzOrte === 1 ? ' Ort, ' : ' Orte, '),
										zeiten_text = (anzZeiten === 1 ? ' Zeit und ' : ' Zeiten und '),
										arten_text = (anzArten === 1 ? ' Art' : ' Arten'), 
										meldung = 'Projekt inklusive ' + anzRaeume + rume_text + anzOrte + orte_text + anzZeiten + zeiten_text + anzArten + arten_text + ' lschen?';
									$("#hpe_lschen_meldung_meldung").html(meldung);
									// Listen anhngen, damit ohne DB-Abfrage gelscht werden kann
									$hoe_lschen_meldung.data('Arten', Arten);
									$hoe_lschen_meldung.data('Zeiten', Zeiten);
									$hoe_lschen_meldung.data('Orte', Orte);
									$hoe_lschen_meldung.data('Raeume', Raeume);
									// popup ffnen
									$("#hpe_lschen_meldung").popup("open");
								}
							});
						}
					});
				}
			});
		}
	});
};

