window.em.handleRaumEditLscheRaumClick = function() {
	'use strict';
	// Anzahl Orte des Raums zhlen
	var $db = $.couch.db("evab");
	$db.view('evab/hOrtIdVonRaum?startkey=["' + localStorage.RaumId + '"]&endkey=["' + localStorage.RaumId + '",{},{}]', {
		success: function(Orte) {
			var anzOrte = Orte.rows.length;
			// Anzahl Zeiten des Raums zhlen
			$db.view('evab/hZeitIdVonRaum?startkey=["' + localStorage.RaumId + '"]&endkey=["' + localStorage.RaumId + '",{},{}]', {
				success: function(Zeiten) {
					var anzZeiten = Zeiten.rows.length;
					// Anzahl Arten des Raums zhlen
					$db.view('evab/hArtIdVonRaum?startkey=["' + localStorage.RaumId + '"]&endkey=["' + localStorage.RaumId + '",{},{}]', {
						success: function(Arten) {
							var anzArten = Arten.rows.length,
								$hre_lschen_meldung = $("#hre_lschen_meldung"),
								orte_text = (anzOrte === 1 ? ' Ort, ' : ' Orte, '),
								zeiten_text = (anzZeiten === 1 ? ' Zeit und ' : ' Zeiten und '),
								arten_text = (anzArten === 1 ? ' Art' : ' Arten'),
								meldung = 'Raum inklusive ' + anzOrte + orte_text + anzZeiten + zeiten_text + anzArten + arten_text + ' lschen?';
							$("#hre_lschen_meldung_meldung").html(meldung);
							// Listen anhngen, damit ohne DB-Abfrage gelscht werden kann
							$hre_lschen_meldung.data('Arten', Arten);
							$hre_lschen_meldung.data('Zeiten', Zeiten);
							$hre_lschen_meldung.data('Orte', Orte);
							// popup ffnen
                            $hre_lschen_meldung.popup("open");
						}
					});
				}
			});
		}
	});
};

