window.em.handleIndexPageshow = function() {
	'use strict';
	// Wenn mglich localStorage.Email fr die Anmeldung verwenden
	// ausser User hat via Men bewusst neu anmelden wollen
	// localStorage muss bei Neuanmeldung geleert werden, sonst werden die Beobachtungen des alten Users gezeigt
	if (localStorage.length > 0) {
		if (localStorage.Email) {
			if (localStorage.UserStatus !== "neu") {
				if (localStorage.Email && localStorage.Autor) {
					window.em.ffneZuletztBenutzteSeite();
					return;
				} else {
					// Userdaten bereitstellen und danach die zuletzt benutzte Seite ffnen
					window.em.stelleUserDatenBereit();
					return;
				}
			}
		}
	}
	// Wenn localStorage.UserStatus neu ist, mssen alle Variabeln entfernt werden, inkl. Username
	window.em.leereAlleVariabeln();
		
	if (!("autofocus" in document.createElement("input"))) {
		$("#Email").focus();
	}
};

