// erstellt Karten fr hProjektListe bis hOrtListe
// im ersten Teil wird die Liste aller Orte erstellt und an den zweiten Teil bergeben
window.em.erstelleKarteH = function(viewname) {
	'use strict';

	// Seitenhhe korrigieren, weil sonst GoogleMap weiss bleibt
	var contentHeight = $(window).height() - 44,
		hOrtLatLngListe;

	$("#MapCanvas").css("height", contentHeight + "px");
	// zustndige hOrtLatLngListe ermitteln
	switch (localStorage.zurueck) {
		case "hProjektListe":
		hOrtLatLngListe = "hOrteLatLngProjektliste";
		break;
	case "hProjektEdit":
	case "hRaumListe":
		hOrtLatLngListe = "hOrteLatLngProjekt";
		break;
	case "hRaumEdit":
	case "hOrtListe":
		hOrtLatLngListe = "hOrteLatLngRaum";
		break;
	}

	// Liste der Orte holen. Prfen, ob sie noch als Variable vorliegt
	if (window.em[hOrtLatLngListe]) {
		window.em.erstelleKarteH_2(window.em[hOrtLatLngListe]);
	} else {
		var $db = $.couch.db("evab");
		$db.view(viewname, {
			success: function (data) {
				window.em[hOrtLatLngListe] = data;
				window.em.erstelleKarteH_2(data);
			}
		});
	}
};

