// wird in BeobEdit.html benutzt
// ffnet die vorige oder nchste Beobachtung
// vorige der ersten => BeobListe
// nchste der letzten => melden
// erwartet ob nchster oder voriger gesucht wird
window.em.nchsteVorigeBeob = function(NchsteOderVorige) {
	'use strict';
	// prfen, ob BeobListe schon existiert
	// nur abfragen, wenn sie noch nicht existiert
	if (window.em.BeobListe) {
		// globale Variable BeobListe existiert noch
		window.em.nchsteVorigeBeob_2(NchsteOderVorige);
	} else {
		// keine Projektliste bergeben
		// neu aus DB erstellen
		var $db = $.couch.db("evab");
		$db.view('evab/BeobListe?startkey=["' + localStorage.Email + '",{}]&endkey=["' + localStorage.Email + '"]&descending=true&include_docs=true', {
			success: function(data) {
				// Globale Variable erstellen, damit Abfrage ab dem zweiten Mal nicht mehr ntig ist
				// bei neuen/Lschen von Beobachtungen wird BeobListe wieder auf undefined gesetzt
				window.em.BeobListe = data;
				window.em.nchsteVorigeBeob_2(NchsteOderVorige);
			}
		});
	}
};

window.em.nchsteVorigeBeob_2 = function(NchsteOderVorige) {
	'use strict';
	var i,
		BeobIdAktuell,
		AnzBeob;
	for (i=0; window.em.BeobListe.rows.length; i++) {
		BeobIdAktuell = window.em.BeobListe.rows[i].doc._id;
		AnzBeob = window.em.BeobListe.rows.length -1;		// vorsicht: Objekte zhlen Elemente ab 1, Arrays ab 0!
		if (BeobIdAktuell === localStorage.BeobId) {
			switch (NchsteOderVorige) {
			case "nchste":
				if (i < AnzBeob) {
					localStorage.BeobId = window.em.BeobListe.rows[i+1].doc._id;
					window.em.leereStorageBeobEdit("ohneId");
					window.em.initiiereBeobEdit();
					return;
				} else {
					window.em.melde("Das ist die letzte Beobachtung");
					return;
				}
				break;
			case "vorige":
				if (i > 0) {
					localStorage.BeobId = window.em.BeobListe.rows[i-1].doc._id;
					window.em.leereStorageBeobEdit("ohneId");
					window.em.initiiereBeobEdit();
					return;
				} else {
					window.em.leereStorageBeobEdit();
					$.mobile.navigate("BeobListe.html");
					return;
				}
				break;
			}
		}
	}
};

